import React, { useEffect }  from 'react'
import Logout from '../components/Auth/Logout';

function LogoutScreen(props) {
    useEffect(() => {
        props.clearSession
        return () => {
            console.log('un-mounting App.js');
        }
    });

    return (
        <div className="main">
            <Logout setToken={props.setToken} />
        </div>
    )
}

export default LogoutScreen
